import React, { Fragment } from "react";
import  ReactDOM  from "react-dom";

 const Overlay = (props) =>{
    <div>
        <div>{props.children}</div>
    </div>
 }
 const holder = document.getElementById('modal')

 const Modal = () =>{
    <Fragment>
        {ReactDOM.createPortal(<Overlay/>,holder)}
    </Fragment>
 }

 export default Modal
